import React, {Component} from 'react';
import '../../App.css';
import axios from 'axios';
import cookie from 'react-cookies';
import {Redirect} from 'react-router';
import { connect } from "react-redux";
import { Field, reduxForm } from "redux-form";
import jwt_decode from 'jwt-decode';


class BuyerSignup extends Component {

    constructor(props) {
        super(props);
        this.state = {

       }
       }


    onSubmit(values){
        this.props.login(values);
    }

    render(){

        let redirectVar = null;
        if(this.props.authFlag){
            redirectVar = <Redirect to = "/patient/registration" />
        }
        const { handleSubmit } = this.props;
        console.log(this.props.errormsg)

        return(
            <div>
                <div class="container">
                <div class="login-form">
                    <div class="main-div">
                        <div class="panel">

                        </div>

                            <div class="form-group">

                                <div className="col-md-4"></div>
                                <div className="col-md-4  outer-box">
                                <div className="col-md-12">   
                                <h3>Create your account</h3>
                                <br/>
                                </div>
                                    <br/><br/>
                                    <div className="col-md-12">
                                    <span className="col-md-5">First Name:</span>
                                    <span className="col-md-2"></span>
                                    <span className="col-md-5">Last Name:</span>
                                    </div>
                                    <br/>
                                    <div>
                                    <div className="col-md-6"><input type="text" class="form-control" name="firstname" required/></div>
                                    <div className="col-md-6"><input type="text" class="form-control" name="lastname" required/></div>
                                    <br/></div>
                                    <div class="form-group" className="col-md-12">
                                    <br/>
                                    Email<br/>
                                    <input type="email" class="form-control" name="email" required />
                                    </div>
                                    <div class="form-group" className="col-md-12">
                                    <br/>
                                    Password (8 charactar minimum)<br/>
                                    <input type="password" class="form-control" name="password" required />
                                    </div>
                                    <div class="form-group" className="col-md-12">
                                    <span>
                                    <br/>
                                    <input type="checkbox" id="chkbox" name="chkbox"/> Keep me signed in</span><br/>
                                    <br/>
                                    <button class="btn btn-primary col-md-12 button">Create your account</button>
                                    </div>
                                    <div class="div-text">
                                    <br/><br/>
                                        or
                                    </div>
                                    <div class="div-text">
                                    <br/><br/>
                                        Have an account? <a>Sign in</a>
                                    <br/>
                                    <br/>
                                    By creating your Grubhub account, you agree to the <a>Terms of Use</a> and <a>Privacy Policy</a>.
                                    </div>
                                </div>   
                                <div className="col-md-4"></div>  
                            </div>           
                        </div>
                </div>
            </div>
            </div>
        )
    }
}

export default BuyerSignup;
